import React from 'react';
import {Route, Switch} from 'react-router-dom';
import '../App.css';
import {ContentComponentStyled} from '../styledComponent/ContentComponent-styled';
import Login from "../contentComponents/Login";
import Header from "./Header";
import Home from '../contentComponents/Home';
import Exit from "../contentComponents/Exit";


const ContentComponent: React.FC = () => (
    <ContentComponentStyled>
        <Switch>
            <Route path="/login">
                <Login/>
            </Route>

            <Route path="/home">
                <Home/>
            </Route>

            <Route path="/exit">
                <Exit/>
            </Route>
        </Switch>
    </ContentComponentStyled>
)


export default ContentComponent;
